case "gd": {
    const fg = require('api-dylux');
    const fs = require('fs');
    const path = require('path');

    let input = body?.trim();
    if (!input) return await ctx.reply("ğŸ“ Please provide a Google Drive link!\nExample: /gdrive https://drive.google.com/file/d/XXXXX/view");

    await ctx.reply("â˜ï¸ Fetching Google Drive file info...");

    try {
        const res = await fg.GDriveDl(input);

        if (!res || !res.downloadUrl) {
            return await ctx.reply("âŒ Failed to fetch Google Drive file info. Please check your link.");
        }

        const message = `
ä¹‚ G O O G L E - D R I V E - D O W N L O A D

â—¦ File Name: ${res.fileName}
â—¦ File Size: ${res.fileSize}
â—¦ File Type: ${res.mimetype}
`;

        // Check file size (~50MB limit)
        const MAX_SIZE_MB = 50;
        let sendDirect = false;
        const fileSizeMatch = res.fileSize.match(/([\d.]+)\s*(KB|MB|GB)/i);

        if (fileSizeMatch) {
            const size = parseFloat(fileSizeMatch[1]);
            const unit = fileSizeMatch[2].toUpperCase();
            if (unit === "KB" || (unit === "MB" && size <= MAX_SIZE_MB)) sendDirect = true;
        }

        if (sendDirect) {
            const filePath = path.join(__dirname, res.fileName.replace(/[\/\\?%*:|"<>]/g, "_"));
            const fileRes = await require("axios").get(res.downloadUrl, { responseType: "stream" });
            const writer = fs.createWriteStream(filePath);
            fileRes.data.pipe(writer);

            await new Promise((resolve, reject) => {
                writer.on("finish", resolve);
                writer.on("error", reject);
            });

            await ctx.replyWithDocument({ source: filePath, filename: res.fileName, mimetype: res.mimetype }, { caption: message });
            fs.unlinkSync(filePath);
        } else {
            await ctx.reply(${message}\nâ¬‡ï¸ Download URL: ${res.downloadUrl});
        }

    } catch (e) {
        console.error(e);
        await ctx.reply("âš ï¸ Error fetching or sending Google Drive file. Please try again later.");
    }

    break;
}
